import { StyleSheet } from "react-native";


const styles = StyleSheet.create({
    container:{
        flex:1,
        backgroundColor: "#121015",
        paddingVertical: 70,
        paddingHorizontal: 30,
    },
    title:{
        color: "#FFF",
        fontSize: 24,
        fontWeight: "bold"
    },
    input:{
        backgroundColor: "#1F1E25",
        color: "#FFF",
        fontSize: 18,
        marginTop: 30,
        borderRadius: 7,
    },
    greetings:{
        color:"#FFF"
    }
})

export default styles
